import React from 'react'
import './App.css';
const Region = () =>{
    /*const datos = [
        {id: 1, nombre: 'ReactJs'},
        {id: 2, nombre: 'vuejs'},
        {id: 3, nombre: 'angular'}
    ]*/
    const [equipo, setEquipo] = React.useState([])

    React.useEffect(() =>{
//console.log('useEffect')
obtenerDatos()
    }, [])
    const obtenerDatos = async () =>{
        const data = await fetch('http://localhost:8054/api/Sexto-Requerimiento')
        const users = await data.json()
        setEquipo(users)
    }
return (
    <div>
        <h1 class="text-center text-primary">Requerimiento 6</h1>
        <table class="table  table-bordered stacktable table-sm">
    <thead>
      <tr class="table-primary" >
      <th scope="col">Rut Cliente</th>
        <th scope="col">Nombre Cliente</th>
        <th scope="col-sm" style={{width: '10px'}}>Codigo Proyecto</th>
        <th scope="col">Fecha Inicio</th>
        <th scope="col">Fecha Fin</th>
        <th scope="col">Costo Real</th>
        <th scope="col">Tiempo Estimado</th>
        <th scope="col">Tiempo Real</th>
        <th scope="col">Rut Contratista</th>
        <th scope="col">Nombre</th>
        <th scope="col">Numero</th>
      </tr>
    </thead>
    <tbody>
{
    equipo.map(item => (
      <tr>
      <th scope="row" key={item.id}>{item.cliente.rut}</th>
      <td>{item.cliente.primerNombre} {item.cliente.segundoNombre} {item.cliente.primerApellido} {item.cliente.segundoApellido}</td>

        <td>{item.id}</td>

      </tr>
     
  
    ))
}
</tbody>
  </table>
        
    </div>
)

}


export default Region;
